text: Why does the sky look red during sunrise and sunset? During sunrise or sunset, the sky appears to change colour. When the Sun is low in the sky, the light has to travel a longer distance through the Earth’s atmosphere so we don’t see the blue light because it gets scattered away. Instead, we see the red and orange light that travels towards us since this light hasn’t been scattered very much. Hence the Sun and skies look redder at dawn and dusk. Skies on other planets Other planets don’t have an atmosphere exactly like ours, and so their skies would look different. Mars’s atmosphere is much thinner than the Earth’s - less than one per cent. The low density of air molecules means that the Rayleigh scattering that causes our skies to be blue on Earth has a very small effect on Mars. We might expect it to have a very faint blue-coloured sky, but due to the haze of dust that remains suspended in the air the daytime sky on Mars appears more yellow. This is because the larger dust particles absorb the short wavelength blue light, and scatter the remaining colours to give a butterscotch hue over the Martian sky. However during a sunrise and sunset on Mars, the sunlight travels a longer distance through its atmosphere and it’s alike to the thickness of the atmosphere on Earth. As such, the blue light gets scattered in all directions and the longer wavelengths of light don’t get scattered much at all – providing a blue glow to the sky around the Sun in the hours around dawn and dusk.

